const Footer = () => {
    const footerStyle = {
      color: 'green',
      fontStyle: 'italic',
      fontSize: 16
    }
    return (
      <div style={footerStyle}>
        <br />
        <em>
          Note app, a practice project for Will
        </em>
      </div>
    )
}

export default Footer
